import { Button } from "@mui/material";
import classes from "./ProjectList.module.css";
import React, { useEffect, useState } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";
import ButtonMission from "../UI/Button";
import TasksList from "../tasks/TasksList";
export interface IProps {
  _id: string;
  nameProject: string;
  staff: string;
  client: string;
  statusProject: string;
}
const ProjectList: React.FC<{ onProps: IProps[] }> = (props) => {
  const [missionData, SetMissionData] = useState([]);

  const ProjectID = async (id: string) => {
    let url = "http://localhost:3001/api/routs/router/allMissionOfProject";
    let res = await axios.post(url, id);
    console.log(res.data);
    console.log(id);

    // .then((response: any) => {
    //   console.log(response);
    // })
    // .catch((err: any) => {
    //   console.log(err);
    // });
  };

  return (
    <div>
      <ul>
        {props.onProps.map((item, index) => {
          return (
            <div className={classes.specificproject} key={index}>
              <li>
                <Button
                  className={classes.allBody}
                  onClick={() => {
                    ProjectID(item._id);
                  }}
                >
                  {`שם:${item.nameProject}`}
                  {`מפתח:${item.staff}`}
                  {`לקוח:${item.client}`}
                  {`סטטוס:${item.statusProject}`}
                </Button>
                <TasksList></TasksList>
              </li>
            </div>
          );
        })}
      </ul>
    </div>
  );
};

export default ProjectList;
